import styled from 'styled-components';
export const HeaderWrapper = styled.div`
    height: 70px;
    width: 100%;
    border-bottom: 3px solid #7c9c99;
    display: flex;
    overflow: hidden;
    min-width: 1200px;

`
export const LogoText=styled.div`
height: 70px;
width: 100%;
pedding-righ: 70px;
box-sizing: border-box;
margin: 0,auto;

`
